const _astro_dataLayerContent = [["Map",1,2,9,10],"meta::meta",["Map",3,4,5,6,7,8],"astro-version","5.3.0","content-config-digest","ac1e762e762876f7","astro-config-digest","{\"root\":{},\"srcDir\":{},\"publicDir\":{},\"outDir\":{},\"cacheDir\":{},\"compressHTML\":true,\"base\":\"/\",\"trailingSlash\":\"ignore\",\"output\":\"server\",\"scopedStyleStrategy\":\"attribute\",\"build\":{\"format\":\"directory\",\"client\":{},\"server\":{},\"assets\":\"_astro\",\"serverEntry\":\"entry.mjs\",\"redirects\":false,\"inlineStylesheets\":\"auto\",\"concurrency\":1},\"server\":{\"open\":false,\"host\":false,\"port\":4321,\"streaming\":true},\"redirects\":{},\"image\":{\"endpoint\":{\"route\":\"/_image\"},\"service\":{\"entrypoint\":\"astro/assets/services/sharp\",\"config\":{}},\"domains\":[],\"remotePatterns\":[]},\"devToolbar\":{\"enabled\":true},\"markdown\":{\"syntaxHighlight\":\"shiki\",\"shikiConfig\":{\"langs\":[],\"langAlias\":{},\"theme\":\"github-dark\",\"themes\":{},\"wrap\":false,\"transformers\":[]},\"remarkPlugins\":[],\"rehypePlugins\":[],\"remarkRehype\":{},\"gfm\":true,\"smartypants\":true},\"security\":{\"checkOrigin\":true},\"env\":{\"schema\":{\"SHOW_BUY_BUTTON\":{\"default\":true,\"context\":\"server\",\"access\":\"public\",\"type\":\"boolean\"},\"SCORE_API_ENDPOINT\":{\"default\":\"3\",\"context\":\"server\",\"access\":\"public\",\"type\":\"string\"}},\"validateSecrets\":false},\"experimental\":{\"clientPrerender\":false,\"contentIntellisense\":false,\"responsiveImages\":false,\"serializeConfig\":false},\"legacy\":{\"collections\":false}}","books",["Map",11,12,34,35,57,58,80,81],"aprendiendo-git",{id:11,data:13,body:23,filePath:24,digest:25,rendered:26,legacyId:33},{title:14,author:15,img:16,readtime:17,description:18,buy:19},"Aprendiendo Git y GitHub","Miguel Ángel Durán","aprendiendo-git.jpg",224,"Aprende a usar Git y GitHub con este libro. Desde lo más básico hasta lo más avanzado.",{spain:20,usa:21,chile:22},"https://www.amazon.es/dp/B08Z7ZQZ3Z","https://www.amazon.com/dp/B08Z7ZQZ3Z","https://www.amazon.cl/dp/B08Z7ZQZ3Z","Hoy en día es imposible imaginar el desarrollo de software sin Git. Según la encuesta de Stack Overflow de 2018, casi el 90% de los desarrolladores usaban Git para manejar su código fuente. Si te preguntas por qué no hay encuestas más recientes... ¡Es simplemente porque no preguntaron más! Su dominio empezaba a ser tan evidente que no dejaba margen a la curiosidad.\r\n\r\nSiendo tan importante entender Git, su manejo y dominio, he decidido escribir este libro. Un **libro que yo mismo hubiera estado encantado de leer cuándo empecé. Un libro del que estoy seguro que podrás extraer algún aprendizaje y que te podrá** servir de guía en el futuro.\r\n\r\nEn el libro te explico los orígenes de Git y por qué ahora lo usa todo el mundo. ¿De dónde nació? ¿Quién lo creó? Además, te explico todos sus fundamentos para que entiendas qué es lo que esconden todos los comando que utilizas en tu día a día.\r\n\r\nDespués de ayudarte a instalar y configurar Git, te explicaré cómo puedes trabajar en Git de forma local y remota y qué diferencias existe entre esos dos modos. Luego haremos repaso de algunas buenas prácticas, cómo usar los alias, los hooks, trucos imprescindibles y muchas cosas más.\r\n\r\n¿Te interesa dominar Git? ¿Quieres una guía que te va a acompañar siempre? ¡Este es tu libro!","src/content/books/aprendiendo-git.md","d7a42c42b3315aef",{html:27,metadata:28},"<p>Hoy en día es imposible imaginar el desarrollo de software sin Git. Según la encuesta de Stack Overflow de 2018, casi el 90% de los desarrolladores usaban Git para manejar su código fuente. Si te preguntas por qué no hay encuestas más recientes… ¡Es simplemente porque no preguntaron más! Su dominio empezaba a ser tan evidente que no dejaba margen a la curiosidad.</p>\n<p>Siendo tan importante entender Git, su manejo y dominio, he decidido escribir este libro. Un <strong>libro que yo mismo hubiera estado encantado de leer cuándo empecé. Un libro del que estoy seguro que podrás extraer algún aprendizaje y que te podrá</strong> servir de guía en el futuro.</p>\n<p>En el libro te explico los orígenes de Git y por qué ahora lo usa todo el mundo. ¿De dónde nació? ¿Quién lo creó? Además, te explico todos sus fundamentos para que entiendas qué es lo que esconden todos los comando que utilizas en tu día a día.</p>\n<p>Después de ayudarte a instalar y configurar Git, te explicaré cómo puedes trabajar en Git de forma local y remota y qué diferencias existe entre esos dos modos. Luego haremos repaso de algunas buenas prácticas, cómo usar los alias, los hooks, trucos imprescindibles y muchas cosas más.</p>\n<p>¿Te interesa dominar Git? ¿Quieres una guía que te va a acompañar siempre? ¡Este es tu libro!</p>",{headings:29,imagePaths:30,frontmatter:31},[],[],{title:14,author:15,img:16,readtime:17,description:18,buy:32},{spain:20,usa:21,chile:22},"aprendiendo-git.md","learning-typescript",{id:34,data:36,body:46,filePath:47,digest:48,rendered:49,legacyId:56},{title:37,author:38,img:39,readtime:40,description:41,buy:42},"Learning TypeScript","Josh Goldberg","learning-typescript.jpg",301,"Domina TypeScript de 0 a experto",{spain:43,usa:44,chile:45},"https://amzn.to/3zlkdes","https://www.amazon.com/-/es/Josh-Goldberg/dp/1098110331","https://www.amazon.cl/-/es/Josh-Goldberg/dp/1098110331","TypeScript has conquered the world of JavaScript: it is one of the world's fastest growing and most popular languages across developer surveys, widely used in consumer and business companies alike, and frequently credited for helping massive web applications scale. But what is TypeScript?\r\n\r\nHow does it work, why does it work, and how can we use it? Learning TypeScript takes beginner to intermediate JavaScript programmers from knowing nothing about **\"types\"** or a \"type system\" to full mastery of the fundamentals of TypeScript. It's more than a means to find bugs and typos--it's a useful system for declaring the way our JavaScript should work and helping us stick to it.\r\n\r\nYou'll learn how TypeScript: interacts with JavaScript **analyzes and understands code augments your existing development pattern helps you document your code works with IDEs to provide refactoring** tools assists local development in refactoring code helps you develop more quickly with fewer bugs","src/content/books/learning-typescript.md","6ce915ffbdb81122",{html:50,metadata:51},"<p>TypeScript has conquered the world of JavaScript: it is one of the world’s fastest growing and most popular languages across developer surveys, widely used in consumer and business companies alike, and frequently credited for helping massive web applications scale. But what is TypeScript?</p>\n<p>How does it work, why does it work, and how can we use it? Learning TypeScript takes beginner to intermediate JavaScript programmers from knowing nothing about <strong>“types”</strong> or a “type system” to full mastery of the fundamentals of TypeScript. It’s more than a means to find bugs and typos—it’s a useful system for declaring the way our JavaScript should work and helping us stick to it.</p>\n<p>You’ll learn how TypeScript: interacts with JavaScript <strong>analyzes and understands code augments your existing development pattern helps you document your code works with IDEs to provide refactoring</strong> tools assists local development in refactoring code helps you develop more quickly with fewer bugs</p>",{headings:52,imagePaths:53,frontmatter:54},[],[],{title:37,author:38,img:39,readtime:40,description:41,buy:55},{spain:43,usa:44,chile:45},"learning-typescript.md","refactoring",{id:57,data:59,body:69,filePath:70,digest:71,rendered:72,legacyId:79},{title:60,author:61,img:62,readtime:63,description:64,buy:65},"Refactoring","Martin Fowler","refactoring.jpg",355,"Buenas prácticas para refactorizar código",{spain:66,usa:67,chile:68},"https://amzn.to/3XLYZ2H","https://www.amazon.com/-/es/Martin-Fowler/dp/0321336380","https://www.amazon.cl/-/es/Martin-Fowler/dp/0321336380","Martin Fowler’s guide to reworking bad code into well-structured code\r\n\r\nRefactoring improves the design of existing code and enhances software maintainability, as well as making existing code easier to understand. Original Agile Manifesto signer and software development thought leader, Martin Fowler, provides a catalog of refactorings that explains why you should refactor; how to recognize code that needs refactoring; and how to actually do it successfully, no matter what language you use.","src/content/books/refactoring.md","b152dcbb940908bf",{html:73,metadata:74},"<p>Martin Fowler’s guide to reworking bad code into well-structured code</p>\n<p>Refactoring improves the design of existing code and enhances software maintainability, as well as making existing code easier to understand. Original Agile Manifesto signer and software development thought leader, Martin Fowler, provides a catalog of refactorings that explains why you should refactor; how to recognize code that needs refactoring; and how to actually do it successfully, no matter what language you use.</p>",{headings:75,imagePaths:76,frontmatter:77},[],[],{title:60,author:61,img:62,readtime:63,description:64,buy:78},{spain:66,usa:67,chile:68},"refactoring.md","programador-pragmatico",{id:80,data:82,body:92,filePath:93,digest:94,rendered:95,legacyId:102},{title:83,author:84,img:85,readtime:86,description:87,buy:88},"Programador Pragmatico","Marco de Paula","programador-pragmatico.jpg",344,"Un libro clásico para mejorar en programación",{spain:89,usa:90,chile:91},"https://amzn.to/3BaK8WQ","https://www.amazon.com/-/es/Andrew-Hunt/dp/020161622X","https://www.amazon.cl/-/es/Andrew-Hunt/dp/020161622X","El programador pragmático es uno de esos raros casos de libros técnicos que se leen, se releen y se vuelven a leer durante años. Tanto si es nuevo en el campo como si es un profesional experimentado, acabará encontrando ideas nuevas cada vez.\r\n\r\nDave Thomas y Andy Hunt escribieron la primera edición de este libro tan influyente en 1999 para ayudar a sus clientes a crear software mejor y a redescubrir el placer de escribir código. Estas lecciones han ayudado a una generación de programadores a examinar la propia esencia del desarrollo de software, independientemente de cualquier lenguaje, framework o metodología en particular, y la filosofía pragmática ha sido el germen de cientos de libros, screencasts y audiolibros, además de miles de carreras e historias de éxito.","src/content/books/programador-pragmatico.md","4191cc00fd0dd587",{html:96,metadata:97},"<p>El programador pragmático es uno de esos raros casos de libros técnicos que se leen, se releen y se vuelven a leer durante años. Tanto si es nuevo en el campo como si es un profesional experimentado, acabará encontrando ideas nuevas cada vez.</p>\n<p>Dave Thomas y Andy Hunt escribieron la primera edición de este libro tan influyente en 1999 para ayudar a sus clientes a crear software mejor y a redescubrir el placer de escribir código. Estas lecciones han ayudado a una generación de programadores a examinar la propia esencia del desarrollo de software, independientemente de cualquier lenguaje, framework o metodología en particular, y la filosofía pragmática ha sido el germen de cientos de libros, screencasts y audiolibros, además de miles de carreras e historias de éxito.</p>",{headings:98,imagePaths:99,frontmatter:100},[],[],{title:83,author:84,img:85,readtime:86,description:87,buy:101},{spain:89,usa:90,chile:91},"programador-pragmatico.md"];

